import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import notes from "../notes.js";
import Note from "./Note";



function App () {
    return <div>
        <Header />
        {notes.map(notesItem => (<Note key={notesItem.key} title={notesItem.title} content={notesItem.content} />))}
        <Footer />
    </div>
}

export default App;
